// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import "../interfaces/IVaultFacet.sol";
import "../interfaces/IKIP7.sol";
import "../utils/math/SafeMath.sol";
import "../interfaces/IUsageFacet.sol";
import "../interfaces/IRewardFacet.sol";


contract VaultTopUpFeatureFacet {
    using SafeMath for uint256;

    uint256 constant private MULTIPLIER_DIVISOR = 10;
    string constant private KEY_LOCK_PERIOD = "lock_period";
    string constant private KEY_LOCK_COUNT = "lock_count";
    string constant private KEY_TOTAL_LOCK_PLUS_LEVEL = "vfinix.TopUpFeature.TotalLock.level";

    event FinixLock(address _user,uint256 indexed _lockAmount,uint256 _vFinixAmount,uint256 indexed _lockIndex,bytes32 indexed _lockKey);
    event FinixLockPlusIncrease(address _user,uint256 indexed _lockAmount,uint256 _vFinixAmount,LibDiamond.LockLevel indexed _level,uint256 indexed _lockInfoIdRef);
    event FinixLockPlus(address _user,uint256 indexed _lockAmount,uint256 _vFinixAmount,LibDiamond.LockLevel indexed _level,uint256 indexed _idLastMaxLv);

    function lockPlus(LibDiamond.LockLevel _level,uint256 idLastMaxLv,uint256 _finixAmount) external {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();

        bytes32 key = keccak256(abi.encode(msg.sender, idLastMaxLv));
        LibDiamond.LockInfo storage lockInfo_ = ds.locksMap[key];

        require(lockInfo_.level == _level,"VFinix: Your Level is invalid.");
        require(getIsLockTopUp(msg.sender,idLastMaxLv) == false,"VFinix: Id must don't lock plus.");
        require(lockInfo_.isUnlocked == false,"VFinix: Id must don't unlock.");
        require(lockInfo_.isPenalty == false,"VFinix: Id must don't penalty.");

        IKIP7(getFinixAddress()).transferFrom(msg.sender, address(this), _finixAmount);
        IRewardFacet(address(this)).harvest(msg.sender);

        (,uint256 multiplier_, , , , ) = _getLockPerioid(_level);
        uint256 vFinixAmount = _finixAmount.mul(multiplier_).div(MULTIPLIER_DIVISOR);
        if(
            block.timestamp >= getTopUpFeatureTimestamp(msg.sender, _level) + getPeriodTopUpFeature()
        ){
            uint256 userLocksCount_ = ds.userLocksCount[msg.sender];
            bytes32 keyNewInfo = keccak256(abi.encode(msg.sender,userLocksCount_));

            ds.locksMap[keyNewInfo] = LibDiamond.LockInfo(userLocksCount_,_level,_finixAmount,vFinixAmount,block.timestamp,0,0,false,false);
            emit FinixLock(msg.sender,_finixAmount,vFinixAmount,userLocksCount_,keyNewInfo);

            LibDiamond.setUint(keccak256(abi.encode(msg.sender, _level,"vfinix.TopUpFeature.InfoId")),userLocksCount_);
            LibDiamond.setUint(keccak256(abi.encode(msg.sender, _level,"vfinix.TopUpFeature.Timestamp")),block.timestamp);

            uint256 lengthLockTopUp = getLengthTopUpLockUser(msg.sender);
            LibDiamond.setBool(keccak256(abi.encode(msg.sender,userLocksCount_,"vfinix.TopUpFeature.isLockTopUp")),true);
            LibDiamond.setUint(keccak256(abi.encode(msg.sender,lengthLockTopUp,"vfinix.TopUpFeature.isLockTopUpList")),userLocksCount_);
            LibDiamond.setUint(keccak256(abi.encode(msg.sender,"vfinix.TopUpFeature.lengthLockTopUp")),lengthLockTopUp.add(1));

            _increaseTotalLockCount();
            _increaseTotalLevelLockCount(_level);

            ds.userLocksCount[msg.sender] = userLocksCount_.add(1);

        }else{
            uint256 lockInfoIdRef = LibDiamond.getUint(keccak256(abi.encode(msg.sender, _level,"vfinix.TopUpFeature.InfoId")));
            bytes32 keylockInfo = keccak256(abi.encode(msg.sender,lockInfoIdRef));

            ds.locksMap[keylockInfo].lockAmount = ds.locksMap[keylockInfo].lockAmount.add(_finixAmount);
            ds.locksMap[keylockInfo].voteAmount = ds.locksMap[keylockInfo].voteAmount.add(vFinixAmount);

            emit FinixLockPlusIncrease(msg.sender,_finixAmount,vFinixAmount,_level,lockInfoIdRef);
        }   

        ds.totalFinixLock = ds.totalFinixLock.add(_finixAmount);
        ds.totalFinixLockAtLevel[_level] = ds.totalFinixLockAtLevel[_level].add(_finixAmount);
        ds.userLocksAmount[msg.sender] = ds.userLocksAmount[msg.sender].add(_finixAmount);
        _increaseTotalLockPlusLevel(_level,_finixAmount);
        _mintVFinix(msg.sender, vFinixAmount);
        _increaseTotalSupplyAllTimeMint(vFinixAmount);
        IRewardFacet(address(this)).deposit(msg.sender,vFinixAmount);       

        emit FinixLockPlus(msg.sender,_finixAmount,vFinixAmount,_level,idLastMaxLv);
    }
     function getIsLockTopUp(address _user,uint256 userLocksCount_) internal view returns(bool) {
        return LibDiamond.getBool(keccak256(abi.encode(_user,userLocksCount_,"vfinix.TopUpFeature.isLockTopUp")));
    }

    function _increaseTotalLockPlusLevel(LibDiamond.LockLevel _level,uint256 _finixAmount) internal {
        uint256 _totalLockPlus = getTotalLockPlusLevel(_level);
        _setTotalLockPlusLevel(_level,_totalLockPlus.add(_finixAmount));
    }

    function _setTotalLockPlusLevel(LibDiamond.LockLevel _level,uint256 _finixAmount) internal {
        LibDiamond.setUint(keccak256(abi.encode(_level,KEY_TOTAL_LOCK_PLUS_LEVEL)),_finixAmount);
    }

    function getTotalLockPlusLevel(LibDiamond.LockLevel _level) public view returns(uint256){
        return LibDiamond.getUint(keccak256(abi.encode(_level,KEY_TOTAL_LOCK_PLUS_LEVEL)));
    }
     function getTotalLockPlusLevels() public view returns(uint256 _totalFinixLockTopUpLv1,uint256 _totalFinixLockTopUpLv2,uint256 _totalFinixLockTopUpLv3){
        _totalFinixLockTopUpLv1 = LibDiamond.getUint(keccak256(abi.encode(LibDiamond.LockLevel.Level1,KEY_TOTAL_LOCK_PLUS_LEVEL)));
        _totalFinixLockTopUpLv2 = LibDiamond.getUint(keccak256(abi.encode(LibDiamond.LockLevel.Level2,KEY_TOTAL_LOCK_PLUS_LEVEL)));
        _totalFinixLockTopUpLv3 = LibDiamond.getUint(keccak256(abi.encode(LibDiamond.LockLevel.Level3,KEY_TOTAL_LOCK_PLUS_LEVEL)));
    }

    function setPeriodTopUpFeature(uint256 _period) public {
        LibDiamond.enforceIsContractOwner();
        LibDiamond.setUint(keccak256(abi.encodePacked("vfinix.TopUpFeature._period")),_period);
    }

     function getPeriodTopUpFeature() public view returns(uint256){
        return LibDiamond.getUint(keccak256(abi.encodePacked("vfinix.TopUpFeature._period")));
    }

     function _increaseTotalSupplyAllTimeMint(uint256 _amount) internal {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        ds.totalSupplyAllTimeMint = ds.totalSupplyAllTimeMint.add(_amount);
    }

     function _mintVFinix(address _holder,uint256 _amount) internal {
        LibDiamond.increaseTotalSupply(_amount);
        LibDiamond.increaseBalance(_holder,_amount);
        emit LibDiamond.Transfer(address(0), _holder, _amount);
    }

     function _increaseTotalLockCount() internal  {
        uint256 totalLockCount = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT)));
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT)),totalLockCount.add(1));
    }

     function _increaseTotalLevelLockCount(LibDiamond.LockLevel _level) internal  {
        uint256 totalLockCount = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,_level)));
        LibDiamond.setUint(keccak256(abi.encodePacked(KEY_LOCK_COUNT,_level)),totalLockCount.add(1));
    }

    function _getLockPerioid(LibDiamond.LockLevel _level) internal view returns(uint256 period_,uint256 multiplier_,uint256 minimum_,uint256 penaltyPeriod_,uint256 penaltyRate_,uint256 penaltyRateDecimal_) {
        period_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"period")));
        multiplier_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"multiplier")));
        minimum_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"minimum")));
        penaltyPeriod_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyPeriod")));
        penaltyRate_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyRate")));
        penaltyRateDecimal_ = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,_level,"penaltyRateDecimal")));
    }

    function getIsTopUpLocks(address _user)public view returns(uint256[] memory){
        uint256 topUpLocklength = getLengthTopUpLockUser(_user);

        uint256[] memory _topUpLocks = new uint256[](topUpLocklength);
        for(uint256 i = 0;i<topUpLocklength;i++){
            _topUpLocks[i] = LibDiamond.getUint(keccak256(abi.encode(msg.sender,i,"vfinix.TopUpFeature.isLockTopUpList")));
        }
        return _topUpLocks;   
    }

    function getTotalLockTopUpLevel(uint256 _level) public view returns(uint256){
        return LibDiamond.getUint(keccak256(abi.encode(_level,"vfinix.TopUpFeature.TotalLock.level")));
    }

    function getIsTopUpLock(address _user,uint256 _lengthLockTopUp)public view returns(uint256){
        return LibDiamond.getUint(keccak256(abi.encode(_user,_lengthLockTopUp,"vfinix.TopUpFeature.isLockTopUpList")));
    }

    function getLengthTopUpLockUser(address _user)public view returns(uint256){
        return LibDiamond.getUint(keccak256(abi.encode(_user,"vfinix.TopUpFeature.lengthLockTopUp")));
    }
    function getFinixAddress()internal view returns(address){
        return LibDiamond.getAddress(keccak256(abi.encodePacked("FINIX")));
    }
    function getTopUpFeatureTimestamp(address _user,LibDiamond.LockLevel _level) internal view returns(uint){
        return LibDiamond.getUint(keccak256(abi.encode(_user, _level,"vfinix.TopUpFeature.Timestamp")));
    }
}
